import axios from "axios"
import { useEffect, useState } from "react"


interface Post {
    id: number;
    title: string;
    body: string;
    image: string;
  }

export function Events() {
    const [listOfPosts, setListOfPosts] = useState<Post[]>([]);

    useEffect(() => {
        axios.get<Post[]>("http://localhost:3001/announcements")
        .then((response) => {
            setListOfPosts(response.data);
        })
        .catch((error) => {
            console.error("Error fetching announcements:", error);
        });
    }, []);



    <div className='more-container h-full w-screen flex flex-col items-center justify-center'>
    <div className='more-header w-full bg-slate-700'>
        <div className='more-text-container mt-36 mb-4 ml-32 font-oswald'>
            <h1 className='text-6xl text-white'>
                MORE
            </h1>
        </div>
    </div>
    <div className='more-content flex flex-col'>

        <p className='mr-20'>Placeholder paragraph</p>

        <p>Placeholder paragraph</p>
    </div>
</div>



    return (
        <div className='events-container h-full w-full flex flex-col items-center justify-center font-oswald'>
            <div className='events-header w-full bg-slate-700'>
                <div className='events-text-container mt-36 mb-4 ml-32'>
                    <h1 className='text-6xl text-white'>
                        EVENTS
                    </h1>
                </div>
            </div>
            <div className='events-content my-16 w-full h-screen flex flex-row justify-normal text-center'>
                <div className='announcements-container mx-64'>
                    <h1 className='mb-8 text-4xl text-slate-700'>
                        ANNOUNCEMENTS
                    </h1>
                    {listOfPosts.map((post) => (
                    <div className="post px-4 py-2 border-4 border-slate-800" key={post.id}>

                        <div className="text-2xl">{post.title}</div>
                        <div className="text-lg">{post.body}</div>
                    </div>
                    ))}
                </div>
                <div className='calendar-container mx-64'>
                    <h1 className='text-4xl text-slate-700'>
                        CALENDAR
                    </h1>
                </div>
            </div>

        </div>
    )
}
